import React from "react";

// reactstrap components
import { Container, Row, Col } from "reactstrap";
import NameCard from "../../assets/img/card.png";

// core components

function Images() {
  return (
    <>
      <Container>
        <Row>
          <Col md="10">
            <img src={NameCard}/>
          </Col>
        </Row>
      </Container>
    </>
  );
}

export default Images;
